INSERT INTO `tb_sys_sql_conf` VALUES ('1', 'sys_permis_tree', '系统权限树', 'select sp.p_id id,sp.parent_id pId,sp.p_name name,\'true\' open,\'false\' nocheck \r\nfrom tb_sys_permis sp WHERE sp.record_status = \'01\' order by sp.p_level,sp.p_sort', '01', '系统权限页面的父权限树', null, '', '', '', '', '01', '2019-04-09 08:30:43', '2019-03-24 15:22:17');
